import React from "react";
import { MenuItems } from "./MenuItems";
import './/navbar.css'

export default function NavBar() {
    let footerStyle = {
        position: "relative",
        // top: '15rem',
        display: 'flex',
        background: "red",
        margin: '0',
        top: "0",
        width: "100%"
    }
    return (
        <nav  className="NavbarItems" >
                <h1 className="navbar-logo">GS:GrihSangini <i className="fab fa-react "></i></h1>
                <div className="menu-icon"></div>
                <ul>
                    {MenuItems.map((item , index) => {
                        return (
                            <li key={index}><a className={item.name} href={item.link}> {item.title} </a></li>
                        )
                    })}
                </ul>
        </nav>
    )
}
